import React from 'react';
import ShowList from './ShowList';


class App extends React.Component {
  constructor() {
    super();
    this.state = {
      feeds: []
    };
  }


  componentDidMount() {
    console.log("test1")
    window.fbAsyncInit = () => {
      window.FB.init({
        appId      : '1747983188680794',
        autoLogAppEvents : true,
        xfbml            : true,
        version          : 'v3.3'
      });

      var token = "EAAY1yA0I4FoBAA70F25h8uPKlWSXMi0KwLkicp4Fbw7b3psJQewhPRF6m5tAWZBTcdTBo7X9dhQHQheJZAxehclZAKA2T2Idj9kRd5YAAi2iSPFe2FJjsarRW535QcjsYLv6BQzCJxHagHN0zGnactuERsOJPzVeR0GZAVcMj42ZC8lOB7QZBKCrKLpcLOviXRnmwoyRmIgAZDZD";
      window.FB.api("/1389776634498901/feed??fields={full_picture,url}", response  =>  {
          console.log(response["data"])
          console.log("testss")
          if (response && !response.error) {
            this.setState({
              feeds: response["data"]
            });
          }
        }, {access_token: token}
      );
    };
  }

  render(){
    const listItems = this.state.feeds.map((feed) =>
        <li key={feed.endpoint}>{feed.endpoint}</li> 
    );
    return (
      <div>
        <div className="fb-header-base">
        </div>
        <div className="fb-header">
          <div id="img1" className="fb-header"><img src="facebook1.png" className = "logo"/></div>
        </div>
        <div className="center">
        <ShowList items={this.state.listItems}/>
      </div> 
      </div> 
    );
  }
}


export default App;
